import React from 'react'
import { NavigationContainer } from '@react-navigation/native'
import { createStackNavigator } from '@react-navigation/stack'

import Landing from './pages/Landing'
import Navigation from './pages/Navigation'
import Mapa from './components/Menu/Mapa'
import Ferramentas from './components/Menu/Ferramentas'
import Saude from './components/Menu/Saude'

const Stack = createStackNavigator()

const Routes = () => {
    return (
        <NavigationContainer>
            <Stack.Navigator
                headerMode="none"
                screenOptions={{
                    cardStyle: { backgroundColor: '#f0f0f5' }
                }}
            >
                <Stack.Screen name="Landing" component={Landing} />
                <Stack.Screen name="Navigation" component={Navigation} />
                <Stack.Screen name="Landing" component={Mapa} />
                <Stack.Screen name="Navigation" component={Ferramentas} />
                <Stack.Screen name="Landing" component={Saude} />
            </Stack.Navigator>
        </NavigationContainer>
    )
}

export default Routes;
